function TopButtons(props) {
  return (
    <>
      <div className="d-flex justify-content-end">
        <button className="btn btn-outline-dark mx-1">
          My Recommendations
        </button>
        <button className="btn btn-outline-dark mx-1">My Favorites</button>
      </div>
      <hr class="p-0" />
    </>
  );
}

export default TopButtons;
